import React from 'react';

import AppBar from 'components/AppBar/AppBar';

const Layout = ({ children, showAppBar = false }) => {
  return (
    <div>
      {
        showAppBar &&
        <AppBar />
      }
      {children}
    </div>
  )
};

export default Layout;
